// Here I wrote a simple root mean squared function to verify my Evaluator code.  This was not necessary, but done for understanding
def calculateError( df:  org.apache.spark.sql.DataFrame, labelCol : String , predictionCol : String) : Double = {

    val tmpdf = df.select(labelCol,predictionCol)
                  .withColumn("rms",((df(labelCol) - df(predictionCol)) * (df(labelCol) - df(predictionCol)) ))
    val ad2d : (Any => Double) = (in:Any) => in.asInstanceOf[java.lang.Double]
    val rmssquare = ad2d(tmpdf.agg(avg("rms")).first()(0))
    scala.math.pow(rmssquare, 0.5)
}

